webpackJsonp([0xf3f88667e51d],{7498:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/76172400/" title="Sleep Two Times"><img src="http://static.flickr.com/40/76172400_1cb29b539b.jpg" width="500" height="375" alt="IMG_0493" /></a></p>\n<p>Christopher is excited that he only has to sleep two more times until Christmas Eve. Mama and I both agree that we\'d rather have another week.</p>\n<p>Our Christmas card features the <a href="http://www.papascott.de/archives/2005/11/26/snow-day/" title="PapaScott &raquo; Blog Archive &raquo; Snow Day">sled photo</a> from last month. We\'ve done our cards the past few years at the <a href="http://www.cardstore.com/asp/usps/">USPS CardStore</a>, and they mail them for us, too.</p>',fields:{title:"Sleep Two Times",date:"22 Dec 2005",url:"https://papascott.de/2005-12-22-sleep-two-times/"}}},pathContext:{slug:"/2005-12-22-sleep-two-times/",prev:{fields:{title:"Night Train",date:"19 Dec 2005",slug:"/2005-12-19-night-train/"}},next:{fields:{title:"Cheney's iPod",date:"23 Dec 2005",slug:"/2005-12-23-cheneys-ipod/"}}}}}});
